  protected boolean error_recovery(boolean debug) throws java.lang.Exception {
    if (debug) {
      debug_message("trying to recover error");
    }

    try_do_reduce(error_sym(), debug);
    boolean flag = super.error_recovery(debug); // try normal recovery
    return flag;
  }

